import React from 'react';
import { motion } from 'framer-motion';
import { FlaskConical, Target, Lightbulb, TrendingUp } from 'lucide-react';
import './Research.css';

const Research = () => {
  const researchAreas = [
    {
      icon: <FlaskConical size={32} />,
      title: 'Experimental Research',
      description: 'Conducting cutting-edge experiments in [specific field] with focus on [specific techniques].',
      keywords: ['Laboratory Methods', 'Data Analysis', 'Protocol Development']
    },
    {
      icon: <Target size={32} />,
      title: 'Applied Research',
      description: 'Translating theoretical concepts into practical applications for real-world problems.',
      keywords: ['Problem Solving', 'Innovation', 'Practical Applications']
    },
    {
      icon: <Lightbulb size={32} />,
      title: 'Theoretical Research',
      description: 'Developing new theoretical frameworks and models to advance understanding in [field].',
      keywords: ['Modeling', 'Simulation', 'Framework Development']
    },
    {
      icon: <TrendingUp size={32} />,
      title: 'Interdisciplinary Research',
      description: 'Collaborating across multiple disciplines to address complex research challenges.',
      keywords: ['Collaboration', 'Cross-disciplinary', 'Integration']
    }
  ];

  const researchStats = [
    { number: '15+', label: 'Years Experience' },
    { number: '50+', label: 'Publications' },
    { number: '10+', label: 'Research Projects' },
    { number: '5+', label: 'Awards & Grants' }
  ];

  return (
    <section className="research section" id="research">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Research</h2>
          <p className="section-subtitle">
            Exploring innovative approaches and contributing to the advancement of knowledge in my field
          </p>
        </motion.div>

        <motion.div 
          className="research-stats"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          {researchStats.map((stat, index) => (
            <div key={index} className="stat-item">
              <div className="stat-number">{stat.number}</div>
              <div className="stat-label">{stat.label}</div>
            </div>
          ))}
        </motion.div>

        <motion.div 
          className="research-areas"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <h3>Research Areas</h3>
          <div className="areas-grid">
            {researchAreas.map((area, index) => (
              <motion.div
                key={index}
                className="research-card card"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                whileHover={{ y: -5 }}
              >
                <div className="area-icon">{area.icon}</div>
                <h4>{area.title}</h4>
                <p>{area.description}</p>
                <div className="keywords">
                  {area.keywords.map((keyword, keyIndex) => (
                    <span key={keyIndex} className="keyword">{keyword}</span>
                  ))}
                </div>
              </motion.div>
            ))}
          </div>
        </motion.div>

        <motion.div 
          className="research-overview"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
        >
          <div className="overview-content">
            <h3>Research Philosophy</h3>
            <p>
              My research philosophy centers around the belief that meaningful scientific advancement 
              comes from a combination of rigorous methodology, innovative thinking, and collaborative 
              effort. I strive to address complex problems through systematic investigation and 
              evidence-based approaches.
            </p>
            <p>
              I am particularly interested in [specific research interests] and how they can be 
              applied to solve real-world challenges. My work emphasizes both theoretical 
              contributions and practical applications, ensuring that research outcomes have 
              meaningful impact.
            </p>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Research;
